package main

import (
	"fmt"
	// "math"
	"strings"
	// "sort"
	// "time"
	"bytes"
)

func main() {
	//do a file input
	input := startInput()
	fmt.Print("Day 5 AOCC\n")
	var minLength = 100000000
	var inputLength = len(input)
	var buffer bytes.Buffer
	//super slow with n^2 but w.e
	for j := 0; j < 26; j++ {
		//remove lower case
		lowerCase := j + 65
		buffer.WriteString(string(lowerCase))
		removeChar := buffer.String()
		input = strings.Replace(input, removeChar, "", -1)
		buffer.Reset()
		//remove uppercase
		upperCase := j + 97
		buffer.WriteString(string(upperCase))
		removeChar = buffer.String()
		input = strings.Replace(input, removeChar, "", -1)
		buffer.Reset()
		fmt.Print(removeChar)
		fmt.Print("\n")
		inputLength = len(input)
		//keep track of largest +1 and guard number
		for i := 1; i < inputLength; i++ {
			char0 := int(input[i-1])
			char1 := int(input[i])
			// fmt.Print(string(input[i-1]))
			if char0-char1 == 32 {
				//remove the list and subtract 1 from i
				buffer.WriteString(string(input[i-1]))
				buffer.WriteString(string(input[i]))
				removeString := buffer.String()
				// fmt.Print(removeString)
				// fmt.Print("\n")
				input = strings.Replace(input, removeString, "", 1)
				//start from the beginning, just going back two went out of range, could make more efficient by just checking if its 1>
				if i-2 >= 1 {
					i -= 2
				} else {
					i = 1
				}
			} else if char1-char0 == 32 {
				//remove the list and subtract 1 from i
				buffer.WriteString(string(input[i-1]))
				buffer.WriteString(string(input[i]))
				removeString := buffer.String()
				// fmt.Print(removeString)
				// fmt.Print("\n")
				input = strings.Replace(input, removeString, "", 1)
				if i-2 >= 1 {
					i -= 2
				} else {
					i = 1
				}
			}
			inputLength = len(input)
			buffer.Reset()
		}
		if minLength > inputLength {
			minLength = inputLength
		}
		input = startInput()
	}
	fmt.Print(minLength)
}

